B.Za=new A.dm("The goal of this section is to let you explore in details how much influence you gained in each divisions.\n                              \nIt is probably empty at the beginning but it will be filled with data as you start sending and receiving tributes.\n\n                              ",null,B.d5,null,B.U,null,null,null,null,null,null,null,null)
