B.Zc=new A.dm("In this section, you will see all the information about the structure of The Corporation\n                              \nYou will be able to see the different divisions, their leaders and what they do.\n                              \nYou will also be able to join/leave the divisions you want to be part of.\n\n                              ",null,B.d5,null,B.U,null,null,null,null,null,null,null,null)
B.Zd=new A.dm('The Corporation was founded by @Pete AKA Weyland in the early days of the game.\n                              \nThe goal of The Corporation is the play the role of the "evil" richest company that have control that extend to each corner of the galaxy.\nSimilar to the Weyland-Yutani corp in Alien, Cyberdyne in Terminator...\n                              \nBeyond this funny image that is more as a joke, our goal is to build a better tommorow while keeping a fun and structured experience of collaboration that spread troughout all the aspects of the game.\n                              \nOur organization is build over the influence system that act as the democracy system of the CORP.\n                              ',null,B.d5,null,B.U,null,null,null,null,null,null,null,null)
B.Ze=new A.dm("For more details, visit the Influence System section.",null,B.Be,null,B.U,null,null,null,null,null,null,null,null)
B.Zf=new A.dm("The profile menu show you all the information about your profile, your roles, your influence system status....\n                              \nThis section will be usefull trought the application to know your tribute balance and your total influence\n                              ",null,B.d5,null,B.U,null,null,null,null,null,null,null,null)
B.Zg=new A.dm("Each divisions have a weight, a percentage of you membership in this division vs another one.\n                              \nThis section will allow you to change the weights of each divisions to reflect your implication in each of them.\n                              \nThis will be used during the tribute calculation to determine how much influence you will gain in each divisions.\n                              \nChoose wisely since this will have a direct impact on your journey in The Corporation\n\n                              ",null,B.d5,null,B.U,null,null,null,null,null,null,null,null)
B.Bj=new A.dm("",null,null,null,null,null,null,null,null,null,null,null,null)
