B.Zi=new A.dm("The structure of The Corporation is divided into Departments and Divisions.\n                              \nThe departments are the main branches that are based on general activities such as Ressources gathering, Exploration, Combat....\n                              \nDivisions are the sub-branches that are based on specific activities such as Mining, Esport, Scouting, Space Combat...\n                              \nYou can join as many divisions as you want, but you will have to specify the importance of each divisions in your profile.\n                              \nThose weights as we call it will be used for your progress as well as how the Corporation will asign ressources to each divisions.\n                              ",null,B.d5,null,B.U,null,null,null,null,null,null,null,null)
B.Zj=new A.dm("This section allow you to send tribute to the people that you think deserve it by their actions in The Corporation.\n                              \nEach week you will receive a certain amount of tribute that you can send to the people you think deserve it.\n                              \nYou can send it to one person or split it between multiple people.\n                              \nThe more lifetime influence you gain, the higher rank you gain and the more tribute you will receive each week.\n\n                              ",null,B.d5,null,B.U,null,null,null,null,null,null,null,null)
B.Zk=new A.dm("The Influence System is a powerful tool that allows you to track your progress in The Corporation.\n                              \nEach week, you receive a set amount of tribute to send to the people that you think deserves it the most.\n                              \nThe generated influence that you and the person receive will be calculated based on both memberships.",null,B.d5,null,B.U,null,null,null,null,null,null,null,null)
